import React from 'react';
import PropTypes from 'prop-types'




export default function Navbar(props) {

    return (
        <>
           <h1>{props.title}</h1>
           <h2>{props.about}</h2>
        </>
    );
}

Navbar.propTypes = {
    title :PropTypes.string,
    about :PropTypes.string
}
Navbar.defaultProps
